(18419, 'CABED7BC-7B48-498D-8077-6F08EA923AE5', 'The last 24 hours have been an incredible roller coaster of highs and a low. My friendship with Jason will now be on ice as he focuses on getting over me and trying to save his marriage. He was here at the conf and we had our last conversation two nights ago. So I️’ve been thinking about my deep need for connectedness and some ideas for how to get/have that without these major upsets/losses. ', '568810432010078400', '569183436409013760', 0, 'Nitzan', 'David', 0, '', '', '', 'iMessage', 'e:nwdave@b-zb.com', '+19172390518', '2019-01-10T02:53:52.010078'),
